import React from 'react';
import Image from 'react-bootstrap/Image';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Carousel } from 'react-bootstrap';
export default function ParkImages(props) {
  return props.images.map((image) => {
    return (
      <div>
        <Carousel>
          <Carousel.Item>
            <img className="d-block w-100" src={image.url} alt={image.id} />
            <Carousel.Caption>
              <h3>{image.title}</h3>
              <p>To be updated.</p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>

        <div>
          <center>
            <Image src={image.url} height={600} />
            <p>{image.title}</p>
          </center>
        </div>
      </div>
    );
  });
}
